
import streamlit as st
import pandas as pd
from io import BytesIO
from docx import Document
import base64

st.set_page_config(page_title="Conversão de TVI em Auto de Infração", layout="centered")

# Função com template embutido
def gerar_docx_preenchido(inscricao, cnpj, razao):
    template_base64 = """"""
    template_bytes = base64.b64decode(template_base64)
    doc = Document(BytesIO(template_bytes))

    for par in doc.paragraphs:
        if "#INSCRICAO" in par.text:
            par.text = par.text.replace("#INSCRICAO", inscricao)
        if "#CNPJ" in par.text:
            par.text = par.text.replace("#CNPJ", cnpj)
        if "#RAZAO" in par.text:
            par.text = par.text.replace("#RAZAO", razao)

    output = BytesIO()
    doc.save(output)
    return output

# Upload da planilha
st.title("Conversão de TVI em Auto de Infração")
arquivo = st.file_uploader("Envie o arquivo Excel", type=["xls", "xlsx"])

if arquivo:
    try:
        df = pd.read_excel(arquivo)
        colunas_necessarias = ['Inscrição Renavam_3', 'CNPJ ou CPF_2', 'Razão_4']
        faltando = [col for col in colunas_necessarias if col not in df.columns]

        if faltando:
            st.error("❌ A planilha está faltando as colunas: " + ", ".join(faltando))
        else:
            inscricao = df['Inscrição Renavam_3'].dropna().astype(str).values[0]
            cnpj = df['CNPJ ou CPF_2'].dropna().astype(str).values[0]
            razao_social = df['Razão_4'].dropna().astype(str).values[0]

            word_output = gerar_docx_preenchido(inscricao, cnpj, razao_social)

            st.success("✅ Documento Word gerado com sucesso!")
            st.download_button(
                label="📄 Baixar Relatório de Conversão",
                data=word_output.getvalue(),
                file_name="Relatorio_de_Conversao.docx",
                mime="application/vnd.openxmlformats-officedocument.wordprocessingml.document"
            )
    except:
        st.error("Erro ao processar a planilha. Verifique se o arquivo está em formato válido.")
